import React, { useState, useEffect } from "react";
import ReactDOM from "react-dom";
import { createPortal } from "react-dom";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./styles.css";

// Mock backend call
const fetchMenuItems = () => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve([{
    name: "Margherita Pizza",
    price: "$10",
    image: "https://uk.ooni.com/cdn/shop/articles/20220211142645-margherita-9920_e41233d5-dcec-461c-b07e-03245f031dfe.jpg?v=1737105431&width=1080",
  },
  {
    name: "Caesar Salad",
    price: "$7",
    image: "data:image/jpeg;base64,",
  },
  {
    name: "Spaghetti Bolognese",
    price: "$12",
    image: "data:image/jpeg;base64,",
  },
      ]);
    }, 1000);
  });
};

const Modal = ({ children, onClose }) => {
  return createPortal(
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal-content" onClick={(e) => e.stopPropagation()}>
        {children}
        <Button onClick={onClose} text="Close" />
      </div>
    </div>,
    document.getElementById("modal-root")
  );
};

const Button = ({ onClick, text }) => (
  <button className="btn" onClick={onClick}>{text}</button>
);

const Header = () => (
  <header className="header">
    <h1>Gourmet Restaurant</h1>
    <nav>
      <Link to="/">Home</Link>
      <Link to="/cart">Cart</Link>
      <Link to="/payment">Payment</Link>
      <Link to="/offers">Special Offers</Link>
    </nav>
  </header>
);

const Footer = () => (
  <footer className="footer">
    <p>&copy; 2025 Gourmet Restaurant. All rights reserved.</p>
  </footer>
);

const MenuItem = ({ item, onAdd }) => (
  <div className="card">
    <img src={item.image} alt={item.name} />
    <h3>{item.name}</h3>
    <p>{item.price}</p>
    <Button onClick={() => onAdd(item)} text="Add" />
  </div>
);



const MenuList = ({ items, onAdd }) => (

  <ul className="menu-list">
    {items.map((item) => (
      <center>
      <MenuItem key={item.id} item={item} onAdd={onAdd} />
      </center>
    ))}
  </ul>
);



const MainPage = ({ menuItems, onAddToCart}) => (
  <div className="main-page">
    <h2 className="fade-in">Menu</h2>
    <MenuList items={menuItems} onAdd={onAddToCart} />
  </div>
);

const CartPage = ({ cart, onClearCart, onRemoveFromCart }) => {
  const total = cart.reduce((sum, item) => {
    const price = parseFloat(item.price.replace("$", ""));
    return sum + (isNaN(price) ? 0 : price);
  }, 0);

  return (
    <div className="cart-page">
      <h2>Your Cart</h2>
      <h3>Total: ${total.toFixed(2)}</h3>
      <div className="menu-list" >
        {cart.map((item, index) => (
          <div style="width:864px;">
          <div key={index} className="card">
            <img src={item.image} alt={item.name} />
            <h3>{item.name}</h3>
            <p>{item.price}</p>
            <Button onClick={() => onRemoveFromCart(index)} text="Remove" />
          </div>
          </div>
        ))}
      </div>
      {cart.length > 0 && (
        <Button onClick={onClearCart} text="Clear Cart" />
      )}
    </div>
  );
};

const handleRemoveFromCart = (indexToRemove) => {
  setCart(cart.filter((_, index) => index !== indexToRemove));
};



const PaymentPage = () => (
  <div className="payment-page">
    <h2>Payment</h2>
    <p>Mock payment form goes here...</p>
  </div>
);

const OffersPage = () => (
  <div className="offers-page">
    <h2>Special Offers & Discounts</h2>
    <ul>
      <li>Buy one get one free on Margherita Pizza</li>
      <li>10% off for orders over $50</li>
    </ul>
  </div>
);

const App = () => {
  const [menuItems, setMenuItems] = useState([]);
  const [cart, setCart] = useState([]);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    fetchMenuItems().then(setMenuItems);
  }, []);

  const handleAddToCart = (item) => {
    setCart([...cart, item]);
    setShowModal(true);
  };

  const handleAddNewDish = (item) => {
    setMenuItems([...menuItems, item]);
  };

  return (
    <Router>
      <div className="main-layout">
      <Header />
      <main className="main-content">
        <Routes>
          <Route path="/" element={<MainPage menuItems={menuItems} onAddToCart={handleAddToCart} onAddNewDish={handleAddNewDish} />} />
          <Route path="/cart" element={<CartPage cart={cart} onClearCart={() => setCart([])} onRemoveFromCart={handleRemoveFromCart} />}/>          
          <Route path="/payment" element={<PaymentPage />} />
          <Route path="/offers" element={<OffersPage />} />
        </Routes>
        {showModal && (
          <Modal onClose={() => setShowModal(false)}>
            <p>Item added to cart!</p>
          </Modal>
        )}
      </main>
      <Footer />
    </div>
    </Router>
  );
};

export default App;
